void sklepSeqMainComponent::buttonClicked (Button* buttonThatWasClicked)
{
    //[UserbuttonClicked_Pre]
    //[/UserbuttonClicked_Pre]

    if (buttonThatWasClicked == optionsButton)
    {
        //[UserButtonCode_optionsButton] -- add your button handler code here..
		if (!options->isVisible())
		{
			options->setVisible (true);
		}
		else
		{
			options->setVisible (false);
		}

		return;
        //[/UserButtonCode_optionsButton]
    }
    else if (buttonThatWasClicked == patternLenDown)
    {
        //[UserButtonCode_patternLenDown] -- add your button handler code here..
		const int l = ownerFilter->getCurrentPattern()->getPatternLength();
		if (l == 1)
			return;

		ownerFilter->getCallbackLock().enter();
		ownerFilter->getCurrentPattern()->setPatternLength(l-1);
		ownerFilter->getCallbackLock().exit();

		patternLenLabel->setText (String::formatted (T("%d"), l-1), false);

		return;
        //[/UserButtonCode_patternLenDown]
    }
    else if (buttonThatWasClicked == patternLenUp)
    {
        //[UserButtonCode_patternLenUp] -- add your button handler code here..
		const int l = ownerFilter->getCurrentPattern()->getPatternLength();
		if (l == 32)
			return;

		ownerFilter->getCallbackLock().enter();
		ownerFilter->getCurrentPattern()->setPatternLength(l+1);
		ownerFilter->getCallbackLock().exit();

		patternLenLabel->setText (String::formatted (T("%d"), l+1), false);

		return;
        //[/UserButtonCode_patternLenUp]
    }
    else if (buttonThatWasClicked == currentPatternDown)
    {
        //[UserButtonCode_currentPatternDown] -- add your button handler code here..
		const int l = ownerFilter->getCurrentPattern()->getPatternId();
		if (l == 0)
			return;

		ownerFilter->getCallbackLock().enter();
		ownerFilter->setCurrentPattern(l-1);
		ownerFilter->getCallbackLock().exit();

		patternChanged();

		return;
        //[/UserButtonCode_currentPatternDown]
    }
    else if (buttonThatWasClicked == currentPatternUp)
    {
        //[UserButtonCode_currentPatternUp] -- add your button handler code here..
		const int l = ownerFilter->getCurrentPattern()->getPatternId();
		if (l == 63)
			return;

		ownerFilter->getCallbackLock().enter();
		ownerFilter->setCurrentPattern(l+1);
		ownerFilter->getCallbackLock().exit();

		patternChanged();

		return;
        //[/UserButtonCode_currentPatternUp]
    }
    else if (buttonThatWasClicked == powerButton)
    {
        //[UserButtonCode_powerButton] -- add your button handler code here..
		ownerFilter->getCallbackLock().enter();
		const bool t = ownerFilter->getCurrentPattern()->getActive();
		const int pId = ownerFilter->getCurrentPattern()->getPatternId();

		if (t)
		{
			ownerFilter->activatePattern (false, pId);
		}
		else
		{
			ownerFilter->activatePattern (true, pId);
		}
		ownerFilter->getCallbackLock().exit();

		patternChanged();

		return;
        //[/UserButtonCode_powerButton]
    }

    //[UserbuttonClicked_Post]
	sklepSeqStep *step = (sklepSeqStep *)buttonThatWasClicked;
	const int i = step->getIndex();

	if (i<0)
		return;

	if (step->getPopup())
	{
		stepQuickEditClicked (step);
	}
	else if (step->getQuickPopup())
	{
		stepQuickEditClicked (step);
	}
	else
	{
		ownerFilter->getCallbackLock().enter();

		sklepSeqPattern *p = ownerFilter->getCurrentPattern();
		p->toggleStep (i);
		ownerFilter->getCallbackLock().exit();
	}
    //[/UserbuttonClicked_Post]
}



//[MiscUserCode] You can add your own definitions of your custom methods or any other code here...
void sklepSeqMainComponent::setPosition (int beat, int bpm)
{
	if (bpm != prevBpm)
	{
		transportComponent->setBpm (bpm);
		clearCursor();
	}

	if (beat != prevPos)
	{
		if (prevPos >= beat)
			clearCursor();

		if (beat-1 >= 0)
			cursor[beat-1]->setVisible (true);

		if (beat-2 >= 0)
			cursor[beat-2]->setVisible (false);

		// currentStepInPatternLabel->setText (String (beat), false);
	}

	prevPos = beat;
	prevBpm = bpm;
}

void sklepSeqMainComponent::handleAsyncUpdate()
{
	ownerFilter->getCallbackLock().enter();
	const int beat = ownerFilter->currentBeat;
	const int bpm = ownerFilter->currentBpm;
	ownerFilter->getCallbackLock().exit();

	setPosition (beat, bpm);
}

void sklepSeqMainComponent::clearCursor()
{
	for (int x=0; x<cursor.size(); x++)
	{
		cursor[x]->setVisible (false);
	}
}

void sklepSeqMainComponent::clearSteps()
{
	for (int x=0; x<step.size(); x++)
	{
		step[x]->setOff();
		step[x]->setToggleState (false, false);
	}
}
void sklepSeqMainComponent::patternChanged()
{
	clearCursor();

	sklepSeqPattern *p = ownerFilter->getCurrentPattern();

	currentPatternLabel->setText (String::formatted (T("%d"), p->getPatternId()), false);
	patternLenLabel->setText (String::formatted (T("%d"), p->getPatternLength()), false);
	options->setPattern (p);

	if (p->getActive())
	{
		powerButton->setImages (false, true, true,
		                     ImageCache::getFromMemory (power_on_png, power_on_pngSize), 0.9000f, Colour (0x0),
		                     ImageCache::getFromMemory (power_on_png, power_on_pngSize), 1.0000f, Colour (0x0),
			                    0, 1.0000f, Colour (0x0));
	}
	else
	{
		powerButton->setImages (false, true, true,
		                     ImageCache::getFromMemory (power_off_png, power_off_pngSize), 0.7000f, Colour (0x0),
		                     ImageCache::getFromMemory (power_off_png, power_off_pngSize), 1.0000f, Colour (0x0),
			                    0, 1.0000f, Colour (0x0));
	}

	clearSteps();

	for (int x=0; x<32; x++)
	{
		if (firstHalf && x>15)
			break;

		if (!firstHalf && x>15)
			continue;

		else if (firstHalf && x<=15)
		{
			if (p->getStep(x))
			{
				step[x]->setOn();
			}
			else
			{
				step[x]->setOff();
			}
		}
		else if (!firstHalf && x>15)
		{
			if (p->getStep(x))
			{
				step[x-15]->setOn();
			}
			else
			{
				step[x-15]->setOff();
			}
		}
	}
}

void sklepSeqMainComponent::stepQuickEditClicked(sklepSeqStep *step)
{
	sklepSeqPattern *p = ownerFilter->getCurrentPattern();
	myMidiMessage *msg = p->getStepNoVeirfy (step->getIndex());

	if (quickEdit)
	{
		deleteAndZero (quickEdit);
	}

	int x,y;
	getMouseXYRelative (x,y);
	quickEdit = new stepQuickEdit (this, msg);

	if (step->getY() > getHeight()/2 && step->getX() < getWidth()-256)
	{
		quickEdit->setBounds (x,y-272,128,272);
	}
	else if (step->getY() > getHeight()/2 && step->getX() > getWidth()-256)
	{
		quickEdit->setBounds (x-128,y-272,128,272);
	}
	else if (step->getY() < getHeight()/2 && step->getX() > getWidth()-256)
	{
		quickEdit->setBounds (x-128,y,128,272);
	}
	else
	{
		quickEdit->setBounds (x,y,128,272);
	}
	addAndMakeVisible (quickEdit);
}

void sklepSeqMainComponent::changeListenerCallback(void *ptr)
{
	if (ptr == options)
	{
		ownerFilter->getCallbackLock().enter();
		sklepSeqPattern *p = ownerFilter->getCurrentPattern();
		p->setMidiChannel (options->getMidiChannel());
		p->setMidiDevice (options->getMidiDevice());
		ownerFilter->getCallbackLock().exit();
	}
}

